import React from "react";

const GreatOperationButton = ({ setResult }) => {
	return (
		<div className="GreatOperationButton">
			<button value="+">+</button>
			<button value="-">-</button>
			<button value="*">*</button>
			<button value="/">/</button>
			<button value=".">.</button>
		</div>
	);
};

export default GreatOperationButton;
